// GetRepoMockHandler returns mock repo files info
func GetRepoMockHandler(c *gin.Context) {
	r := Repo{}
	err := json.Unmarshal(mockResult, &r)
	if err != nil {
		utils.Abort(c, http.StatusInternalServerError, "bad mock")
	}
	utils.Reply(c, http.StatusOK, "OK", r)
}

